import logo from './logo.svg';
import './App.css';
import Sidenav from './components/Sidenav';
import Line from './components/Line';
import Pie from './components/Pie';
import Table from './components/Table';
import Profile from './components/Profile';

function Home() {
  return (
    <div className='main'>
      <div className='row'>
        <Profile />
      </div>
      <div className='card'>
        <Line />
      </div>
      <div className='card'>
        <Pie />
      </div>
      <div className='card'>
        <Table />
      </div>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Sidenav />
      <Home />
    </div>
  );
}

export default App;
